contracts/SecureToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract SecureToken is ERC20, ReentrancyGuard, Ownable, Pausable {
    using SafeERC20 for IERC20;

    // Events
    event TransactionExecuted(
        address indexed from,
        address indexed to,
        uint256 amount,
        uint256 timestamp,
        string transactionType
    );
    
    event UserRegistered(
        address indexed userAddress,
        string username,
        uint256 timestamp
    );

    event TransactionFeeUpdated(
        uint256 oldFee,
        uint256 newFee,
        uint256 timestamp
    );

    event EmergencyStateChanged(
        bool isPaused,
        uint256 timestamp
    );

    // Structs
    struct Transaction {
        address from;
        address to;
        uint256 amount;
        uint256 timestamp;
        string transactionType;
        bool completed;
    }

    struct User {
        string username;
        uint256 registrationDate;
        bool isRegistered;
        uint256 totalTransactions;
    }

    // Constants
    uint256 public constant MAX_USERNAME_LENGTH = 32;
    uint256 public constant MAX_FEE = 0.01 ether;

    // State variables
    mapping(address => User) public users;
    mapping(address => Transaction[]) public userTransactions;
    
    uint256 public transactionFee = 0.001 ether;
    uint256 public totalTransactions;
    uint256 public totalUsers;

    constructor() ERC20("SecureToken", "STK") {
        _mint(msg.sender, 1000000 * 10**decimals());
    }

    // Modifiers
    modifier onlyRegisteredUser() {
        require(users[msg.sender].isRegistered, "User not registered");
        _;
    }

    // User Registration
    function registerUser(string memory username) public whenNotPaused {
        require(!users[msg.sender].isRegistered, "User already registered");
        require(bytes(username).length > 0, "Username cannot be empty");
        require(bytes(username).length <= MAX_USERNAME_LENGTH, "Username too long");

        users[msg.sender] = User({
            username: username,
            registrationDate: block.timestamp,
            isRegistered: true,
            totalTransactions: 0
        });

        totalUsers++;
        emit UserRegistered(msg.sender, username, block.timestamp);
    }

    // Transaction Functions
    function transfer(address to, uint256 amount) 
        public 
        virtual 
        override 
        whenNotPaused
        nonReentrant 
        returns (bool) 
    {
        _transferWithFee(msg.sender, to, amount);
        return true;
    }

    function transferMultiple(address[] calldata recipients, uint256[] calldata amounts)
        public
        whenNotPaused
        nonReentrant
        returns (bool)
    {
        require(recipients.length == amounts.length, "Arrays length mismatch");
        require(recipients.length > 0, "Empty arrays");
        
        uint256 totalAmount = 0;
        for(uint256 i = 0; i < amounts.length; i++) {
            totalAmount += amounts[i];
        }
        
        uint256 totalFee = transactionFee * recipients.length;
        require(balanceOf(msg.sender) >= totalAmount + totalFee, "Insufficient balance");

        for(uint256 i = 0; i < recipients.length; i++) {
            _transferWithFee(msg.sender, recipients[i], amounts[i]);
        }

        return true;
    }

    function _transferWithFee(address from, address to, uint256 amount) internal {
        require(users[from].isRegistered, "Sender not registered");
        require(to != address(0), "Invalid recipient address");
        require(amount > 0, "Amount must be greater than 0");
        require(balanceOf(from) >= amount + transactionFee, "Insufficient balance");

        _transfer(from, to, amount);
        _transfer(from, owner(), transactionFee);

        // Record transaction
        Transaction memory newTransaction = Transaction({
            from: from,
            to: to,
            amount: amount,
            timestamp: block.timestamp,
            transactionType: "Transfer",
            completed: true
        });

        userTransactions[from].push(newTransaction);
        users[from].totalTransactions++;
        totalTransactions++;

        emit TransactionExecuted(
            from,
            to,
            amount,
            block.timestamp,
            "Transfer"
        );
    }

    // View Functions
    function getUserTransactions(address userAddress) 
        public 
        view 
        returns (Transaction[] memory) 
    {
        return userTransactions[userAddress];
    }

    function getUserInfo(address userAddress) 
        public 
        view 
        returns (
            string memory username,
            uint256 registrationDate,
            uint256 totalTx,
            uint256 balance
        ) 
    {
        User memory user = users[userAddress];
        return (
            user.username,
            user.registrationDate,
            user.totalTransactions,
            balanceOf(userAddress)
        );
    }

    // Admin Functions
    function setTransactionFee(uint256 newFee) public onlyOwner {
        require(newFee <= MAX_FEE, "Fee too high");
        uint256 oldFee = transactionFee;
        transactionFee = newFee;
        emit TransactionFeeUpdated(oldFee, newFee, block.timestamp);
    }

    function withdrawFees() public onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No fees to withdraw");
        payable(owner()).transfer(balance);
    }

    // Utility Functions
    function getContractBalance() public view onlyOwner returns (uint256) {
        return address(this).balance;
    }

    function getTransactionCount() public view returns (uint256) {
        return totalTransactions;
    }

    // Emergency Functions
    function pause() public onlyOwner {
        _pause();
        emit EmergencyStateChanged(true, block.timestamp);
    }

    function unpause() public onlyOwner {
        _unpause();
        emit EmergencyStateChanged(false, block.timestamp);
    }

    // Token Recovery
    function recoverToken(IERC20 token) public onlyOwner {
        require(address(token) != address(this), "Cannot recover native token");
        uint256 balance = token.balanceOf(address(this));
        require(balance > 0, "Nothing to recover");
        token.safeTransfer(owner(), balance);
    }

    // Internal Functions
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual override {
        super._beforeTokenTransfer(from, to, amount);
        
        if (from != address(0) && to != address(0)) { // Skip minting and burning
            require(!paused(), "Token transfers paused");
            if (from != owner()) { // Skip registration check for owner
                require(users[from].isRegistered, "Sender not registered");
            }
        }
    }

    // Receive function to accept ETH
    receive() external payable {}
}

